import { useState } from "react"
import Nav from "../component/Nav";

const handlesubmit=()=>
{
    console.log('submitted')
}
const handleChange=()=>
{
    console.log('change')
}
const Onboard =()=>{
    return (
        <>
            <Nav
            minimal={true}
            setShowModal={()=> {}}
            showModal={false}
            />
            <div className="onbaord">
                <h2>CREATE ACCOUNT</h2>

                <form onSubmit={handlesubmit}>
                    <section>
                    <label htmlFor="first_name">First Name</label>
                        <input
                            id="first_name"
                            type="text"
                            name="first_name"
                            placeholder="First Name"
                            required={true}
                            value={""}
                            onChange={handleChange}
                        />
                    <label >Date Of Birth</label>
                    <div className="multiple-iput-container">
                        <input
                            id="dob_day"
                            type="number"
                            name="dob_day"
                            placeholder="DD"
                            required={true}
                            value={""}
                            onChange={handleChange}
                        />
                        <input
                            id="dob_month"
                            type="text"
                            name="dob_month"
                            placeholder="MM"
                            required={true}
                            value={""}
                            onChange={handleChange}
                        />
                        <input
                            id="dob_year"
                            type="text"
                            name="dob_year"
                            placeholder="YYYY"
                            required={true}
                            value={""}
                            onChange={handleChange}
                        />
                    </div>

                    <label >Date Of Birth</label>
                    <div className="multiple-iput-container">
                        <input
                            id="female_gender_identity"
                            type="radio"
                            name="gender"
                            placeholder="DD"
                            value={"female"}
                            onChange={handleChange}
                            checked={false}
                        />
                        
                    <label htmlFor="female">Female</label>
                        <input
                            id="male_gender_identity"
                            type="radio"
                            name="gender"
                            placeholder="DD"
                            value={"male"} 
                            onChange={handleChange}
                            checked={false}
                        />
                        <label htmlFor="male">male</label>
                    </div>
                    <label>Motive</label>
                        <input
                            id="project_seeker"
                            type="radio"
                            name="project_seeker"
                            value="seeker"
                            on
                            />
                    </section>
                </form>

            </div>
        </>
    )
}
export default Onboard
